    class MyDataContext : DbContext
    {
        protected override void OnConfiguring(DbContextOptionsBuilder optionsBuilder)
        {
            if(!optionsBuilder.IsConfigured)
            {
                optionsBuilder
                    .UseSqlServer(@"Server=(localdb)\MSSQLLocalDb;Database=ConcurrencyDb;Trusted_Connection=True;");
            }
        }

        public DbSet<Person> People { get; set; }
    }

    class Program
    {
        static void Main(string[] args)
        {
            var ctx1 = new MyDataContext();
            var person = ctx1.People.FirstOrDefaultAsync().Result;
            if (person == null)
            {
                person = new Person { Name = "A" };
                ctx1.Add(person);
                ctx1.SaveChanges();
            }

            // Simulate two person access same resource
            var p1 = ctx1.People.FirstOrDefaultAsync().Result;
            var ctx2 = new MyDataContext();
            var p2 = ctx2.People.FirstOrDefaultAsync().Result;

            p1.Name = p1.Name == "A" ? "B" : "A";
            p2.Name = p2.Name == "A" ? "B" : "A";

            try
            {
                ctx1.SaveChanges();
            }
            catch(DbUpdateConcurrencyException)
            {
                Console.WriteLine("Concurrency Ctx1 occured.");
            }

            try
            {
                ctx2.SaveChanges();
            }
            catch (DbUpdateConcurrencyException)
            {
                Console.WriteLine("Concurrency Ctx2 occured.");
            }
        }
    }
}`

